import { defineStore } from 'pinia';

export const useDataStore = defineStore('dataStore', {
  state: () => ({
    nextWorkitems: [] // 추가
  }),
  actions: {
    increment() {
      this.count++;
      console.log( this.nextWorkitems );
    //   console.log(this.count);
    },
    decrement() {
      this.count--;
    //   console.log(this.count);
    },
    nextWorkItems(nextItem) { 
    console.log(nextItem );
      this.nextWorkitems = nextItem;
    }
  }
});
